contracts/Products.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

// ürünlerin barkodu olmalı
// toplamda 3 durak olmalı
// ürünlerin hangi duraklarda olduğunu görebilmeliyim
// ürünler bir önceki durağa gidemez
// ürünler her seferinde 1 durak ilerler
// her durağa bir cüzdan ekleyebilir

contract Products{

    struct Product{
        uint8 barcode;
        uint8 station;
    }

    Product[] productList;
    mapping(uint8 => address) wallets;
    uint8[] stations = [1, 2, 3];

    function addProduct(uint8 _barcode, uint8 _station) public{
        require(_station <= 3 && _station >= 1, "Station value is invalid.");

        Product memory newProduct = Product({
            barcode: _barcode,
            station: _station
        });
        
        productList.push(newProduct);
    }

    function getProductList() public view returns(Product[] memory){
        return productList;
    }

    function getStation(uint8 _barcode) public view returns(uint8){
        for (uint i = 0; i < productList.length; i++) {
            if (productList[i].barcode == _barcode) {
                return productList[i].station;
            }
        }
        return 0;
    }
    
    function changeStation(uint8 _barcode) public{
        for (uint i = 0; i < productList.length; i++) {
            if (productList[i].barcode == _barcode) {
                require(productList[i].station != 3, "It is in the last station");
                productList[i].station++;
            }
        }
    }

}

